import React from 'react';



class Tooltip extends React.Component{
    classp=()=>{

        return `${this.props.pos}`;
    }

    render(){
        return (
            <div className={`${this.classp()}`}>
                Thanks for hovering! I'm a tooltip
            </div>
        )
    }
}


export default Tooltip;
